import React, { Component } from 'react';
import "../css/course-list.style.css";
import {Navbar, Form, Nav, FormControl,Button} from "react-bootstrap";
import Toggle from './Toggle';
import {HiOutlineViewList} from 'react-icons/hi';

class CourseNavbar extends Component {
    state = {  }
    render() { 
        return (
            <div className="container">
                <Navbar bg="light" variant="light">
                    <HiOutlineViewList className="topIcon"/>

                    <Navbar.Brand href="#home" className="active hidden-xs hidden-sm">Course Manager</Navbar.Brand>
                    <Nav className="mr-auto active hidden-xs hidden-sm">
                    <Nav.Link href="#home" >Home</Nav.Link>
                    <Nav.Link href="#features">Features</Nav.Link>
                    <Nav.Link href="#pricing">Pricing</Nav.Link>
                    </Nav>
                    <Form inline>
                    <FormControl type="text" placeholder="New Course" className="mr-sm-2" />
                    <Button variant="outline-danger">+</Button>
                    </Form>
                </Navbar>
            </div>  
          );
    }
}

export default CourseNavbar;
